import "./portfolio.scss";

export default function Portfolio() {
    return (
        <div className="skills" id="portfolio">
            <h1>Portfolio</h1>
            <ul>
                <li>Featured</li>
                <li>Web App</li>
                <li>Mobile App</li>
                <li></li>
            </ul>
        </div>
    );
}
